import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import axios from "axios";
import SelectSexo from "./componentes/SelectSexo";
import SelectRoles from "./componentes/SelectRoles";
import { Check } from "lucide-react";

function Usuario() {
  const location = useLocation();

  const [user, setUser] = useState(location.state);

  const handleInput = (event) => {
    setUser((prev) => ({
      ...prev,
      [event.target.name]: event.target.value,
    }));
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    axios
      .post("http://localhost:8081/usuarios/usuario", user)
      .then((res) => {
        alert("usuario agregado");
      })
      .catch((err) => {
        alert("error");
      });
  };

  //   useEffect(()=>{
  //     axios.post("http://localhost:8081/usuarios/usuario",)
  //   })

  return (
    <div className="w-full">
      <div className="flex justify-between bg-zinc-200 pt-6 pb-3 shadow-sm">
        <div className="flex-row space-y-0.5 pl-6">
          <span className="text-xl font-semibold">Usuario</span>
          <p className="text-xs text-slate-500">Datos del Usuario</p>
        </div>
      </div>
      <div id="usuarios_contenedor">
        <div>
          <form action="" onSubmit={handleSubmit}>
            {/*  INPUT NOMBRE */}
            <div>
              <p>Nombre</p>
              <input
                type="text"
                name="nombre"
                placeholder={user.usu_id}
                onChange={handleInput}
              />
            </div>

            {/*  INPUT APELLIDO PATERNO */}
            <div>
              <p>Apellido Paterno</p>
              <input
                type="text"
                name="ap"
                placeholder="Apellido Paterno"
                onChange={handleInput}
              />
            </div>

            {/*  INPUT APELLIDO MATERNO */}
            <div>
              <p>Apellido Materno</p>
              <input
                type="text"
                name="am"
                placeholder="Apellido Materno"
                onChange={handleInput}
              />
            </div>

            {/*  INPUT SEXO */}
            <div>
              <SelectSexo name="sexo" handleInput={handleInput} />
            </div>

            {/*  INPUT TELEFONO */}
            <div>
              <p>Numero de Telefono</p>
              <input type="text" name="telefono" onChange={handleInput} />
            </div>

            {/*  INPUT DIRECCION */}
            <div>
              <p>Direccion</p>
              <input type="text" name="direccion" onChange={handleInput} />
            </div>

            {/*  INPUT RFC */}
            <div>
              <p>RFC</p>
              <input type="text" name="rfc" onChange={handleInput} />
            </div>
            {/*  INPUT PASSWORD */}
            <div>
              <p>Contrase√±a</p>
              <input type="text" name="password" onChange={handleInput} />
            </div>

            {/*  INPUT ROL */}
            <div>
              <p>Rol de Empleado</p>
              <SelectRoles name={"rol"} handleInput={handleInput} />
            </div>
            <button
              className="bg-blue-500 flex justify-center items-center rounded-xl py-1.5 px-8 font-medium text-white gap-2"
              type="submit"
            >
              {<Check className="w-6 h-6" />}
              Agregar Usuario
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Usuario;
